  const handelClick = () => {
    setModal(!modal);
  };
  return (
 <>
  <section className="call-to-action">
    <h2>Hurry up Book your Tickets!</h2>

    <button onClick={handelClick}>
      Know More!
      </button>
  </section>
  {modal && <Modals modal />}

 </>
    )
}

export default CallToAction
